CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertSeats` ()   BEGIN
    DECLARE comp_id INT;
    DECLARE seat_num INT;
    DECLARE max_comp_id INT;
    DECLARE counter INT DEFAULT 1;

    -- Get the maximum compartment ID
    SELECT MAX(id) INTO max_comp_id FROM compartments;

    -- Loop through each compartment
    WHILE counter <= max_comp_id DO
        -- Check if the compartment ID exists
        IF EXISTS (SELECT 1 FROM compartments WHERE id = counter) THEN
            SET seat_num = 1;
            -- Insert 50 seats for the current compartment
            WHILE seat_num <= 50 DO
                SET seat_num = seat_num + 1;
            END WHILE;
        END IF;
        SET counter = counter + 1;
    END WHILE;
END$$

